import java.util.*;
downloadPath = input.get("uploadedImage").downloadPath;
adminLink = additionalData.applicationConfiguration.get("env_filePath");
input.remove("uploadedImage");
application = input.get("application");
if(downloadPath != null && downloadPath != ""){
    images = [];

    if (application.?images.size > 0){
        images = application.images;
    }

    images.add({"url": (adminLink + downloadPath)});

    output.put("application", {
        "images": images
    });
}
